import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {
    Nav, NavItem, Navbar, Collapse, NavbarText, Row, Col
} from 'reactstrap';
import logoWpp from '../elements/imagenes/logo-wpp.svg';
import logoIg from '../elements/imagenes/logo-ig.svg';
import '../estilos-todos.css';
import { useResponsiveTools } from '../elements/someFunctions.js';

export const BarraInferior = () => {
    const { hideItems, itemsAreVisible, windowWidth } = useResponsiveTools();
    return (
        <div>
            <Navbar color="warning" expand="md" light>
                <Collapse navbar>
                    <Nav className="me-auto" navbar>
                        <NavItem className='full-izq'>
                            {/* <div className='container-fluid full-izq'>
                                <Row>
                                    <Col sm='6' className='orientacion-izquierda'>
                                        <div> */}
                            <Row>

                                <NavbarText>
                                    <img src={logoWpp} className="mini-logo" alt="logo-wpp" />
                                    +99 999 9999 9999
                                </NavbarText>
                                {/* </div>
                                    </Col>
                                    <Col sm='6' className='orientacion-izquierda'>
                                        <div> */}
                                <NavbarText>
                                    <img src={logoIg} className="mini-logo" alt="logo-ig" />
                                    @Rafaela.chocolates
                                </NavbarText>
                            </Row>
                            {/* </div>
                                    </Col>
                                </Row>
                            </div> */}
                        </NavItem>
                    </Nav>
                </Collapse>
            </Navbar>
        </div>
    )
}
